import "./EmployeeBirthday.css";

function EmployeeBirthday(props) {
  const month = props.DOB_month;
  const day = props.DOB_day;
  const year = props.DOB_year;

  return (
    <div className="employee-birthday">
      <div className="employee-birthday__month">{month}</div>
      <div className="employee-birthday__day">{day}</div>
      <div className="employee-birthday__year">{year}</div>
    </div>
  );
}

export default EmployeeBirthday;
